Pin works in tandem with the Unpin marker. Pinning makes it possible to guarantee that an object implementing !Unpin won't ever be moved. To understand why this is necessary, we need to remember how async/.await works. Consider the following code: let fut_one = /* ... */;
let fut_two = /* ... */;
async move { fut_one.await; fut_two.await;
} Under the hood, this creates an anonymous type that implements Future, providing a poll method that looks something like this: // The `Future` type generated by our `async { ... }` block
struct AsyncFuture { fut_one: FutOne, fut_two: FutTwo, state: State,
} // List of states our `async` block can be in
enum State { AwaitingFutOne, AwaitingFutTwo, Done,
} impl Future for AsyncFuture { type Output = (); fn poll(mut self: Pin<&mut Self>, cx: &mut Context<'_>) -> Poll<()> { loop { match self.state { State::AwaitingFutOne => match self.fut_one.poll(..) { Poll::Ready(()) => self.state = State::AwaitingFutTwo, Poll::Pending => return Poll::Pending, } State::AwaitingFutTwo => match self.fut_two.poll(..) { Poll::Ready(()) => self.state = State::Done, Poll::Pending => return Poll::Pending, } State::Done => return Poll::Ready(()), } } }
} When poll is first called, it will poll fut_one. If fut_one can't complete, AsyncFuture::poll will return. Future calls to poll will pick up where the previous one left off. This process continues until the future is able to successfully complete. However, what happens if we have an async block that uses references? For example: async { let mut x = [0; 128]; let read_into_buf_fut = read_into_buf(&mut x); read_into_buf_fut.await; println!("{:?}", x);
} What struct does this compile down to? struct ReadIntoBuf<'a> { buf: &'a mut [u8], // points to `x` below
} struct AsyncFuture { x: [u8; 128], read_into_buf_fut: ReadIntoBuf<'what_lifetime?>,
} Here, the ReadIntoBuf future holds a reference into the other field of our structure, x. However, if AsyncFuture is moved, the location of x will move as well, invalidating the pointer stored in read_into_buf_fut.buf. Pinning futures to a particular spot in memory prevents this problem, making it safe to create references to values inside an async block.

