When performing multiple asynchronous operations, it's tempting to simply .await them in a series: async fn get_book_and_music() -> (Book, Music) { let book = get_book().await; let music = get_music().await; (book, music)
} However, this will be slower than necessary, since it won't start trying to get_music until after get_book has completed. In some other languages, futures are ambiently run to completion, so two operations can be run concurrently by first calling each async fn to start the futures, and then awaiting them both: // WRONG -- don't do this
async fn get_book_and_music() -> (Book, Music) { let book_future = get_book(); let music_future = get_music(); (book_future.await, music_future.await)
} However, Rust futures won't do any work until they're actively .awaited. This means that the two code snippets above will both run book_future and music_future in series rather than running them concurrently. To correctly run the two futures concurrently, use futures::join!: use futures::join; async fn get_book_and_music() -> (Book, Music) { let book_fut = get_book(); let music_fut = get_music(); join!(book_fut, music_fut)
} The value returned by join! is a tuple containing the output of each Future passed in.

